import React, { Component } from "react";
import Portfolio from './../Portfolio/Portfolio';
export default class Investmentstyle extends Component {
    state={
data:[
    {
        heading:"Money Market",
        nav:"$10.02",
        units:"9,530,495.01",
        market:"$95,495.01"
    },
    {
        heading:"Conservative grouth",
        nav:"$10.02",
        units:"9,530,495.01",
        market:"$95,495.01"
    },
    {
        heading:"Income",
        nav:"$10.02",
        units:"9,530,495.01",
        market:"$95,495.01"
    }
]
    }
  render() {
    return (
      <div>
          <div>
          <div>Your Allocation</div>
          <div>Investment Performance</div>
          </div>
          <div>Portfolio Builders</div>
          {this.state.data.map(value =>(
            <Portfolio value/>
          ))}
           
      </div>
    );
  }
}
